import CirclePage from "./Components/middlepage";
import NavBar from "./Components/Nav";
function App() {
  const navbarlink=['Home','About','Service','Contact'];
  return (
    <div className="App" >
      <NavBar link={navbarlink}/>
      <CirclePage/>
    </div>
  );
}

export default App;
